Leap seconds may also be used.

~~~~
# use chrono::NaiveDate;
let dt = NaiveDate::from_ymd(2015, 6, 30).and_hms_milli(23, 59, 59, 1_500);
assert_eq!(format!("{:?}", dt), "2015-06-30T23:59:60.500");
~~~~

